Audio &amp; Motion - Elektronica 12 (04-09-2010)


The 12th of a weekly series by the up and coming DJ, Audio &amp; Motion. Follow Audio &amp; Motion on Facebook for updates, previous episodes, streaming, and download links.



Facebook Page: (Look for &quot;Audio &amp; Motion&quot; on Facebook)

Track List Available At: http://AudioAndMotion.com/elektronica/episode12.php

1. Nadia Ali - Not Thinking (Green &amp; Falkner Remix)
2. Blake Jarell - Maresias (Arnej Remix)
3. Markus Schulz, Khaz - Dark Heart Waiting (Lost Stories Remix)
4. M6 - The Rising
5. Aly &amp; Fila, Denise Rivera - My Mind Is With You
6. Mercie, DJ Eco, Badlands - Garden State (Ben Nicky &amp; James Kitcher Vocal Mix)
7. John O'Callaghan, Audry Gallagher - Big Sky (Markus Schulz Remix)
